import React, { Component } from "react";

class BuyList extends Component {
  render() {
    const lists = [
      { id: 1, name: "とまと" },
      { id: 2, name: "たまご" },
      { id: 3, name: "キャベツ" },
      { id: 4, name: "豚肉" },
    ];
    return <p>{lists.map((list) => list.name)}</p>;
  }
}

export default BuyList;
